import React from 'react'
import { f304 } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

export const Todo = ({task}) => {
    return (
        <div className="Todo">
            <p>
                {task.task}
                <FontAwesomeIcon icon="fa-solid fa-pen" />
            </p>
        </div>
    )
}
